import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import Post from "./components/Tools/Profile/MyPosts/Post/Post";
import Message from "./components/Tools/Dialogs/Messages/Message/Message";
import Friend from "./components/Tools/Dialogs/Friends/Friend/Friend";

let postData = [
    {message: 'Hello, World', likes: 15 },
    {message: 'Its My Life', likes: 60} ,
    {message: 'HELLOMOTHERFUCKER', likes: 12 },
    {message: 'CHE NAHYI??', likes: 22 },
]

let postElement = postData.map( post => <Post message={post.message} likes={post.likes}/>)

let messageData = [
    {message: 'Hello, World', id: 1},
    {message: 'Yo', id: 2},
    {message: 'Poshel nahyi', id: 3},
]
let messageElement = messageData.map(m => <Message message={m.message} id={m.id} />)

let friendData = [
    {name: 'Arman', id: 1},
    {name: 'Nurik', id: 2},
    {name: 'Madya', id: 3},
    {name: 'Damik', id: 4},
    {name: 'Sam', id: 5},
]
let friendElement = friendData.map(f => <Friend name={f.name} id={f.id}/>)


ReactDOM.render(
    <React.StrictMode>
        <App/>
    </React.StrictMode>,
    document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();

export { postElement, messageElement, friendElement};
